description:
We, ODDEPOXY, believe in free music. It's amazing how limited music can become and how much passion is lost when budgets and profit margins start to muddle the clarity of what is otherwise one of the most beautiful things we humans can create. In the past we sometimes found ourselves focusing too much on what music could earn us and how it could be a profitable endeavor, though now we've realized that there is no price for something so personal and enjoyable. Our music will be free.

